import React from "react"
import './Index.css'
import Video from '../Videos/fundo_home.mp4'

export default function Home(){

    return(
        <section className='home-container'>
            <video  width="320" height="240" controls>
                <source src="movie.mp4" type={Video}/>
            </video>
        </section>
    )
}
